import './App.css';

function App() {
  return (
    <div className="App" >
      <header className="App-header">
     <big> <big>  <big>  <strong><p style={{color:'#4c7ddd'}}>Pazaak</p> </strong></big></big></big>
     &nbsp;
      <div class="wrapper">
     <div class="hidelogo"></div>
    <div class="hidelogo2"></div> 
    &nbsp;
    <iframe  title="PazaakFrame" src="https://trinket.io/embed/pygame/f9650decb4?outputOnly=true" width="800" height="400" frameborder="0" marginwidth="0" marginheight="0" scrolling="no" seamless="seamless" allowfullscreen></iframe>
</div>
&nbsp;

<iframe  title="PazaakWookie" src="https://starwars.fandom.com/wiki/Pazaak/Legends" width="800" height="490" frameborder="0" marginwidth="0" marginheight="0" allowfullscreen></iframe>


      </header>

    </div>
  );
}

export default App;
